// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { TransactionProvider } from './contexts/TransactionContext'; // Adjust the path if necessary

ReactDOM.render(
  <React.StrictMode>
    <TransactionProvider>
      <App />
    </TransactionProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
